import { Person } from "../context/PersonContext"

interface CardProps {
  person: Person
  handlePerson : (name:string) => void
}

const Card = ({person, handlePerson}: CardProps): JSX.Element =>{

    return(
        <>
            <div>Nombre: {person.name}</div>
            <div>Apellido: {person.lastName}</div>
            <div>Apellido: {person.age}</div>
            <button onClick={() => handlePerson(person.name)}>Delete</button>
        </>
    )
}

export default Card;
